Dokumenta filmo de Mihhail Kaufman kaj Mihhail Kopalin, kiu montras vivon de Moskvo en la 1920-aj jaroj. Kun subtitoloj en Esperanto. Vd. pli detale che: http://kinejo.blogsome.com/2008/01/12/moskvo-1927/

Documentary by Mikhail Kaufman (brother of Dziga Vertov and cameraman of his early works) and Mikhail Kopalin, which portrays life of Moscow in the 1920s. Intertitles in Russian and Esperanto. IMDB info - http://imdb.com/title/tt0018172/

